    calculateRatio(num1, num2) {
        if (num1 && num2) {
            num1 = parseFloat(num1);
            num2 = parseFloat(num2);
            for (let num = num2; num > 1; num--) {
                if ((num1 % num) === 0 && (num2 % num) === 0) {
                    num1 = num1 / num;
                    num2 = num2 / num;
                }
            }
            this.purchaseDetailFormGroup.patchValue({
                psQty: num1,
                psQtyDisc: num2
            });
        }
    }
